def check_column_name(folder_path):
    '''
    :param folder_path:
    :return: file list with diff columns' names and the number of files of that folder
    '''
    diff = []
    num = 0
    index_set = []
    for _, _, files in os.walk(folder_path):
        print(files)
        #print('aaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaa')
        #original = ['Time', 'InstanceType', 'Region', 'AZ', 'SPS', 'IF', 'OndemandPrice', 'SpotPrice', 'Savings']
        original = ['InstanceType', 'AZ', 'SpotPrice', 'Region', 'SPS', 'OndemandPrice', 'IF', 'Savings', 'time', 'id']
        for f in files:
            cur_csv_path = folder_path + r'/' + f
            print(cur_csv_path)
            df = pd.read_csv(cur_csv_path)
            if list(df.columns) != original:
                diff.append(f)
                if list(df.columns) not in index_set:
                    index_set.append(list(df.columns))
        num = len(files)
    return diff, num, index_set

